import React from 'react';
import { Link } from 'react-router-dom';
import '../Styles/HomePage.css';

export default function HomePage() {
  return (
    <main className="home-container">
      <h1 className="home-title">Welcome to Open Source Project Finder</h1>
      <p className="home-desc">
        Discover open-source projects that match your skills, interests, and favorite technologies.
      </p>
      <Link to="/search" className="home-link">Start Searching</Link>
    </main>
  );
}
